import React from 'react';
import AppLayout from 'next/head';
import Head from 'next/dist/next-server/lib/head';

const Profile=()=>{
    return (
        <>
            <Head>
                <title>내프로필 | NodeBird</title>
            </Head>
            <AppLayout>내 프로필</AppLayout>
        </>
    )
}

export default Profile;
